&lt;img src=&quot;http://www.ebgames.com/ebx_assets/product_images/243587x.jpg&quot;280&quot; border=&quot;0&quot;&gt;

&lt;p&gt;Fight to the top in a groundbreaking new story mode to achieve NASCAR stardom. Start from humble beginnings by earning Modified, Truck, and NASCAR rides before grabbing million-dollar purses in the NASCAR Nextel Cup Series. Develop your racing skills and intimidate your rivals on the track with all-new controls. Off the track, force the action with post-race confrontations, and settle disputes with NASCAR stars by racing America's top production cars through city streets. Fans react to the drama, idolizing both NASCAR heroes and villains with every move. Owners and sponsors recognize talent and reward success. It's up to you to show 'em what you've got. &lt;p/&gt;
